import logo from '../logo.svg';
import '../App.css';
import Navbar from '../Navbar/Navbar';

function Profil() {

    return (
      <div className="App">
        <Navbar />
        <div class="maDiv">
        <img src="https://html.com/wp-content/uploads/flamingo.jpg"  className="monImage"  alt="Description de l'image" style={{ maxWidth: '100%', maxHeight: '100%' }} />
      <p>Voici une description de l'image</p>
        </div>
      </div>
    );
  }
  

export default Profil;
